import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './components/Home';
import Portfolio from './components/Portfolio';
import ResumeAndCertificates from './components/ResumeAndCertificates';
import AboutMe from './components/AboutMe';
import Contact from './components/Contact';
import Skills from './components/Skills';
import Services from './components/Services';
import NavbarCasual from './components/NavBar/NavbarCasual';
import NavbarProfessional from './components/NavBar/NavbarProfessional';

import './App.css';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/casual/*" element={<CommonLayout navbar={<NavbarCasual />} />}>
          <Route path="/" element={<div>Casual Home Content</div>} />
          <Route path="resume-and-certificates" element={<ResumeAndCertificates />} />
          <Route path="portfolio" element={<Portfolio />} />
          <Route path="about-me" element={<AboutMe />} />
          <Route path="contact" element={<Contact />} />
        </Route>
        <Route path="/professional/*" element={<CommonLayout navbar={<NavbarProfessional />} />}>
          <Route path="/" element={<div>Professional Home Content</div>} />
          <Route path="portfolio" element={<Portfolio />} />
          <Route path="services" element={<Services />} />
          <Route path="skills" element={<Skills />} />
          <Route path="contact" element={<Contact />} />
        </Route>
      </Routes>
    </Router>
  );
};

const CommonLayout = ({ navbar, children }) => {
  return (
    <div>
      {navbar}
      {children}
    </div>
  );
};

export default App;
